import React from "react";
import Navbar from "../../components/navbar/Navbar";
import Footer from "../../components/footer/Footer";
import "./myleave.scss";

function MyLeave() {
  return (
    <div className="container">
      <Navbar />
      <div className="myleave">myleave</div>
      <Footer />
    </div>
  );
}

export default MyLeave;
